const LoginForm = ({
    formdata,
    updateFormdata,
    apiError,
    handleLogin
}) => {
    return (
        <form onSubmit={handleLogin}>
            <div>
                {apiError && <p>{apiError}</p>}
                <h2>ログイン</h2>
                <div id="container">
                    <p>ユーザー名</p>
                    <input 
                        type="text" 
                        value={formdata.name}
                        onChange={updateFormdata}>
                    </input>
                </div>
                <div>
                    <p>パスワード</p>
                    <input 
                        type="password" 
                        value={formdata.password}
                        onChange={updateFormdata}>
                    </input>
                </div>
                <div>
                    <button type="submit">
                        ログイン
                    </button>
                </div>
            </div>
        </form>
    );
};

export default LoginForm;
